        private readonly ElevationsDbContext _context;

        public RestaurantBuilder(ElevationsDbContext context)
        {
            _context = context;
        }

        public List<Dishes> Restaurant
        {
            get
            {
                return GetInitialRestaurants();
            }
        }

        public void Create()
        {
            CreateRestaurantCategories();
        }

        private void AddRestaurantIfNotExists(Dishes dishes)
        {
            if (_context.Dishes.IgnoreQueryFilters().Any(l => l.Name == dishes.Name))
            {
                return;
            }

            _context.Dishes.Add(dishes);
            _context.SaveChanges();
        }

        private void CreateRestaurantCategories()
        {
            foreach (Dishes restaurant in Restaurant)
            {
                AddRestaurantIfNotExists(restaurant);
            }
        }

